import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <Header />
      <Intro />
    </div>
  );
}

const Header = () => {
  return (
    <div className="menu">
      <a href=''>Home</a>
      <a href=''>News</a>
      <a href=''>Messages</a>
    </div>
  )
}

const Intro = () => {
  <div className="introduction">
    <img src={logo} className="App-logo" alt="logo" />
    <p>
      Edit <code>src/App.js</code> and save to reload. This is project to learn ReactJS.
    </p>
    <a
      className="App-link"
      href="https://reactjs.org"
      target="_blank"
      rel="noopener noreferrer"
    >
      Learn React
    </a>
  </div>
}

export default App;
